import { NgModule } from '@angular/core';
import { CommonModule } from '@angular/common';
import { FormsModule } from '@angular/forms';

import { IonicModule } from '@ionic/angular';

import { ConsultationModifPageRoutingModule } from './consultation-modif-routing.module';

import { ConsultationmodifPage } from './consultation-modif.page';

@NgModule({
  imports: [
    CommonModule,
    FormsModule,
    IonicModule,
    ConsultationModifPageRoutingModule
  ],
  declarations: [ConsultationmodifPage]
})
export class ConsultationModifPageModule {}
